import { List, ListItem, ListItemIcon, ListItemText } from '@mui/material'
import React from 'react'
import DashboardIcon from '@mui/icons-material/Dashboard';
import BookIcon from '@mui/icons-material/Book';
import PostAddIcon from '@mui/icons-material/PostAdd';
import NotificationsActiveIcon from '@mui/icons-material/NotificationsActive';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';

export default function SidenavData() {
    const listItemData = [
        {label:"DashBorad", icon:<DashboardIcon/>},
        {label:"Blog Post", icon:<BookIcon/>},
        {label:"Link 1", icon:<PostAddIcon/>},
        {label:"Notification", icon:<NotificationsActiveIcon/>},
        {label:"Logout", icon:<ExitToAppIcon/>}
    ]

  return (
    <List>
    {listItemData.map((item,i)=>(
        <ListItem components={navLink} key={i}>
        <ListItemIcon>{item.icon}</ListItemIcon>
        <ListItemText>{item.label}</ListItemText>
        </ListItem>
    ))}
        
    </List>
  )
}
